package ConstructorConcept;

public class ParentClassConsA {
	
	public ParentClassConsA() {
		
		System.out.println("ParentClassConsA----");
		
	}
	
public ParentClassConsA(int i) {
		
		System.out.println("Parameter ParentClassConsA----ai "+i);
		
	}
public ParentClassConsA(int i, int j) {
	
	System.out.println("Parameter ParentClassConsA----i "+i);
	System.out.println("Parameter ParentClassConsA----j "+j);
}

	public static void main(String[] args) {
		// TODO Auto-generated method stub

	}

}
